import React from 'react';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import '../stylesheets/formStyle.css'

const OrgForm = ({ setForm, formData, nextStep })=>{
    const {next} = nextStep;
    return(
        <div>
            <Form className="container">
                <h3>Organization Information</h3>
                <Form.Group>
                    <Form.Label>Organization</Form.Label>
                    <Form.Control type="text" placeholder="Organization Name" />
                    <Form.Text className="text-muted">
                        Answer "Independent" or "N/A" if under no organization.
                    </Form.Text>
                </Form.Group>
                <Form.Label>Representative</Form.Label>
                <Form.Group className="container">

                    <div className="row">
                        <Form.Control className="col-sm" type="text" placeholder="First Name" />
                        <Form.Control className="col-sm" type="text" placeholder="Last Name" />
                    </div>
                </Form.Group>
                <Form.Group>
                    <Form.Label>Contact Information</Form.Label>
                    <Form.Control type="number" placeholder="Phone Number" />
                    <Form.Control type="email" placeholder="Email" />
                </Form.Group>
                <Button onClick={next} variant="info">Next</Button>{' '}
            </Form>
        </div>
    );
}

export default OrgForm;
